const Index = props => (
    <Layout>
        <h3>PROFIL MAHASISWA STIKOM PGRI BANYUWANGI</h3>
        <h4>Nama :ADITYA WAHYUNIZAR
        Tempat,Tgl Lahir : Banyuwangi, 5 NOVEMBER 1999<br/>
        Alamat : Banyuwangi<br/> 
        Pekerjaan : Mahasiswa/ Guru <br/>
        Hobi : Futsal<br/>
        NIM : 1118101630<br/>
        JURUSAN : S1 TEKNIK INFORMATIKA - MALAM 2018
        </h4>
    </Layout>
);

export default Index;
